    false,nt"url": null,nt"notes": "BPI Structures are derived from a focal
    mean analysis on bathymetry and slope. The bathymetry grid (5 m cell size) is derived
    from two sources: Multibeam bathymetry collected by Coral Reef Ecosystem Division
    aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; multibeam bathymetry collected aboard
    the US Naval Ship Sumner by the Naval Oceanographic Office, and also lidar, also
    collected by the Naval Oceanographic Office. BPI Structures was created using the
    Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/). Cell values represent
    one of 13 classes in an index of seafloor terrains. This data set is for Saipan
    Islands, Commonwealth of the Northern Marianas (CNMI).",nt"license_title":
